    class PairComparer : IComparer<(float, string)>
    {
        public int Compare((float, string) x, (float, string) y)
        {
            return x.Item1 == y.Item1
                ? x.Item2.CompareTo(y.Item2)
                : x.Item1.CompareTo(y.Item1);
        }
    }
    private void Awake()
    {
        possibleSecrets = new List<string>(dictionary);
        wordRankings = new SortedList<(float, string), bool>(cachedRankings.Count);
        foreach (var tuple in cachedRankings)
        {
            wordRankings.Add(tuple, false);
        }
        rankings = new ConcurrentQueue<(int, string, float)>();
    }
    void Start()
    {
        censorPossibleSecrets();
        currentlyTriedWord = "";
        wordComparisons = (long)dictionary.Count * (long)possibleSecrets.Count;
        totalWordComparisons = (long)dictionary.Count * (long)possibleSecrets.Count;
        currentWordsTried = dictionary.Count;

    }

    void Test()
    {
        double totalTimeOfMine = 0.0;
        double totalTimeOfDads = 0.0;
        int corrects = 0;
        int amountToTry = UnityEngine.Random.Range(100000, 1000000);
        for (int i = 0; i < amountToTry; i++)
        {
            string word1 = dictionary[UnityEngine.Random.Range(0, dictionary.Count)];
            string word2 = dictionary[UnityEngine.Random.Range(0, dictionary.Count)];

            double timeBefore = nanoTime();
            var maxword = CharKnowledge.getColoursForWord(word1, word2);
            totalTimeOfMine += nanoTime() - timeBefore;

            timeBefore = nanoTime();
            var dadword = CharKnowledge.getColoursForWordle(word1, word2);
            totalTimeOfDads += nanoTime() - timeBefore;
            if (ListEquals(maxword, dadword))
            {
                corrects += 1;
            }
        }
        print("Total time on Max's: " + totalTimeOfMine / 1e9);
        print("Total time on Dad's: " + totalTimeOfDads / 1e9);
        print("Correct ones: " + corrects + "/" + amountToTry);
    }

    public static void censorPossibleSecrets()
    {
        censoredPossibleSecrets = new List<string>(possibleSecrets);
        for (int i = 0; i < badWords.Count; i++)
        {
            if (censoredPossibleSecrets.Contains(badWords[i]))
            {
                int index = censoredPossibleSecrets.FindIndex(a => a.Contains(badWords[i]));
                StringBuilder word = new StringBuilder(censoredPossibleSecrets[index]);
                int j = 0;
                foreach (char c in word.ToString())
                {
                    if (j > 0)
                    {
                        word[j] = '*';
                    }
                    j++;
                }
                censoredPossibleSecrets[index] = word.ToString();
            }
        }
    }
    public static void assert(bool condition, string message = "Assertion failed")
    {
        UnityEngine.Debug.Assert(condition, message);
        if (!condition)
            throw new Exception(message);
    }
    public static bool calcWordRankings(IDictionary<char, CharKnowledge> knowledge)
    {
        totalWordComparisons = (long)dictionary.Count * (long)possibleSecrets.Count;
        wordComparisons = 0L;
        currentWordsTried = 0;
        WordleData.taskRunning = true;
        try
        {
            SortedList<(float, string), bool> currentWordRankings = new SortedList<(float, string), bool>(new PairComparer());
            wordRankings = currentWordRankings;

            var perWord = Bits.LongsPerWord(alphabet);
            ulong[] bitmap = new ulong[possibleSecrets.Count * perWord];

            //set bits
            {
                int i = 0;
                foreach (string possibleSecret in possibleSecrets)
                    Bits.BitMapTo(possibleSecret, alphabet, bitmap, i++ * perWord);
            }
            // for each bit, construct an index, and sort SHORTEST FIRST
            SortedList<(int, int), int> matchesToBitNumber = new SortedList<(int, int), int>();
            int bitCount = WordleData.wordLength * alphabet.Length * 3;
            ulong[][] filteredBitmaps = new ulong[bitCount][];
            for (int bitNumber = 0; bitNumber < bitCount; bitNumber++)
            {
                ulong[] syntheticBitMask = Bits.blank(alphabet);
                Bits.SetBits(syntheticBitMask, 0, bitNumber);
                int matches = 0;
                for (int k = 0; k < bitmap.Length; k += perWord)
                    if (Bits.AndIs0(syntheticBitMask, bitmap, k))
                        matches++;
                if (matches > 0 && matches < (possibleSecrets.Count / 1.1f))
                {
                    matchesToBitNumber.Add((matches, bitNumber), bitNumber);

                    ulong[] filteredBitmap = new ulong[perWord * matches];
                    int target = 0;
                    for (int k = 0; k < bitmap.Length; k += perWord)
                    {
                        if (Bits.AndIs0(syntheticBitMask, bitmap, k))
                        {
                            for (int p = 0; p < perWord; p++)
                                filteredBitmap[target++] = bitmap[k + p];
                            //Buffer.BlockCopy(bitmap, k * sizeof(ulong), filteredBitmap, target, perWord * sizeof(ulong));
                            //target += perWord * sizeof(ulong);
                        }
                    }
                    filteredBitmaps[bitNumber] = filteredBitmap;
                }
            }
            int[] preferredBits = matchesToBitNumber.Values.ToArray();

            foreach (var word in dictionary)
            {
                currentlyTriedWord = word;
                float totalxprime = 0;
                foreach (var possiblesecret in possibleSecrets)
                {
                    if (WordleData.stopTask)
                    {
                        currentlyTriedWord = "";
                        return false;
                    }
                    var colours = CharKnowledge.getColoursForWord(word, possiblesecret);
                    var newKnowledge = CharKnowledge.fromGuess(word, colours);
                    newKnowledge = CharKnowledge.combineKnowledge(newKnowledge, knowledge);
                    newKnowledge = CharKnowledge.inferFully(WordleData.wordLength, newKnowledge);

                    ulong[] mask = Bits.BitMask(newKnowledge, alphabet);

                    var smallestBitmap = bitmap;

                    //! do we have to index it in the quadratic loop?
                    for (int o = 0; o < preferredBits.Length; o++)
                    {
                        ulong[] syntheticBitMask = Bits.blank(alphabet);
                        Bits.SetBits(syntheticBitMask, 0, preferredBits[o]);
                        if (!Bits.AndIs0(syntheticBitMask, mask, 0))
                        {
                            smallestBitmap = filteredBitmaps[preferredBits[o]];
                            break;
                        }
                    }

                    int xprime = 0;
                    for (int k = 0; k < smallestBitmap.Length; k += perWord)
                    {
                        if (Bits.AndIs0(mask, smallestBitmap, k))
                        {
                            xprime++;
                        }
                    }

                    wordComparisons++;
                    totalxprime += xprime;
                }
                var key = ((totalxprime / possibleSecrets.Count), word);
                lock (currentWordRankings)
                {
                    currentWordRankings.Add(key, false);
                }
                var index = currentWordRankings.IndexOfKey(key);
                rankings.Enqueue((index, word, key.Item1));
                currentWordsTried++;
                //currentWordsTriedDecimal = currentWordsTried;
                //time = Time.time;
            }
            currentlyTriedWord = "";
            return true;
        }
        catch (Exception e)
        {
            UnityEngine.Debug.LogError(e.Message + "\n" + e.StackTrace);
            return true;
        }
        finally
        {
            WordleData.taskRunning = false;
        }
    }
    public static List<string> BitFilter(ulong[] mask, ulong[] possibleSecretsBitmap, List<string> possibleSecrets)
    {
        List<string> result = new List<string>();
        int perWord = Bits.LongsPerWord(alphabet);
        for (int i = 0; i < possibleSecrets.Count; i++)
        {
            if (Bits.AndIs0(mask, possibleSecretsBitmap, perWord * i))
            {
                result.Add(possibleSecrets[i]);
            }
        }
        return result;
    }
    public static long nanoTime()
    {
        long nano = 10000L * Stopwatch.GetTimestamp();
        nano /= TimeSpan.TicksPerMillisecond;
        nano *= 100L;
        return nano;
    }
    public static bool ListEquals(IList a, IList b)
    {
        if (a.Count != b.Count) return false;
        for (int i = 0; i < a.Count; i++)
            if (!a[i].Equals(b[i])) return false;
        return true;
    }

    public enum Colour {Gray, Yellow, Green, Missing}

    public static ulong ColoursToNum(IList<Colour> colours) {
        ulong result = 0;
        foreach (var colour in colours)
        {
            result = (result << 2) | (ushort)colour;
        }
        return result;
    }

