    public class CharKnowledge
    {
        public CharKnowledge() { }
        public CharKnowledge(CharKnowledge src)
        {
            definitePositions = new HashSet<int>(src.definitePositions);
            unavailablePositions = new HashSet<int>(src.unavailablePositions);
            atLeastThisManyMore = src.atLeastThisManyMore;
            grayBeyond = src.grayBeyond;
        }
        public static string MapToString<K, V>(IDictionary<K, V> map)
        {
            IDictionary<K, V> copy = new Dictionary<K, V>(map);
            StringBuilder result = new StringBuilder();
            foreach (var kv in copy)
            {
                result.Append(kv.Key.ToString());
                result.Append(" : ");
                result.Append(kv.Value.ToString());
                result.AppendLine();
            }
            return result.ToString();
        }

        public override string ToString()
        {
            return ""
            + " definite: " + "{" + String.Join(",", definitePositions) + "}"
            + " unavail: " + "{" + String.Join(",", unavailablePositions) + "}"
            + " grayBeyond: " + (grayBeyond == null ? "null" : grayBeyond + "");
        }

        static IDictionary<char, ISet<int>> stringToCharPositions(string s, IDictionary<char, ISet<int>> constrain)
        {
            var map = new Dictionary<char, ISet<int>>(s.Length);
            int pos = 0;
            foreach (char c in s)
            {
                if (!map.ContainsKey(c))
                    map.Add(c, new HashSet<int>());
                if (constrain == null || constrain.ContainsKey(c) && constrain[c].Contains(pos))
                    map[c].Add(pos);
                pos++;
            }
            return map;
        }
        public static List<Colour> getColoursForWordle(string guess, string actualWord)
        {
            var map = stringToCharPositions(actualWord, null);
            var hits = stringToCharPositions(guess, map);

            var counts = new Dictionary<char, int>(guess.Length);
            var result = new List<Colour>(guess.Length);
            int pos = 0;
            foreach (char c in guess)
            {
                if (!counts.ContainsKey(c))
                    counts.Add(c, 0);
                result.Add(map.ContainsKey(c)
                               ? map[c].Contains(pos)
                                   ? Colour.Green
                                   : counts[c]++ < (map[c].Count - hits[c].Count) ? Colour.Yellow : Colour.Gray
                               : Colour.Gray);
                pos++;
            }
            return result;
        }
        //***********************! GET COLOURS FOR WORD !***********************\\
        public static List<Colour> getColoursForWord(string guess, string actualWord)
        {
            List<Colour> colours = new List<Colour>();
            List<char> guessList = new List<char>(guess.ToCharArray());
            List<char> actualWordList = new List<char>(actualWord.ToCharArray());
            bool[] thereCouldBeAYellowHere = new bool[guessList.Count];
            for (int i = 0; i < guessList.Count; i++)
            {
                colours.Add(Colour.Gray);
            }

            for (int i = 0; i < guessList.Count; i++)
            {

                Colour colourToAddPerLetter = Colour.Gray;
                for (int e = 0; e < actualWordList.Count; e++)
                {

                    //? guessList[i] is current guess letter
                    //? actualWordList[e] is current answer letter to compare guess letter to
                    if (guessList[i] == actualWordList[e])
                    {
                        thereCouldBeAYellowHere[i] = false;
                        if (i == e)
                        {
                            colourToAddPerLetter = Colour.Green;

                        }
                        else
                        {
                            if (colourToAddPerLetter != Colour.Green)
                            {
                                thereCouldBeAYellowHere[i] = true;
                            }
                        }
                    }
                }
                bool guessedNotMore = getAmountOfInListThatAreNotGray(guessList[i], guessList, colours) <= getAmountOfInList(guessList[i], actualWordList);
                colours[i] = guessedNotMore ? colourToAddPerLetter : Colour.Gray;
            }

            for (int i = 0; i < guessList.Count; i++)
            {
                if (thereCouldBeAYellowHere[i] == true)
                {
                    if (colours[i] != Colour.Green)
                    {
                        colours[i] = Colour.Yellow;
                    }
                }
            }


            // I literally don't know what I'm doing here, but it works somehow
            for (int i = guessList.Count - 1; i > -1; i--)
            {
                int amountOfNonGraysInGuess = getAmountOfInListThatAreNotGray(guessList[i], guessList, colours); //2
                int amountOfInAnswer = getAmountOfInList(guessList[i], actualWordList); //3
                int amountOfExtraInGuess = amountOfNonGraysInGuess - amountOfInAnswer; //2-3

                if (amountOfExtraInGuess > 0)
                {
                    if (colours[i] == Colour.Yellow)
                    {
                        colours[i] = Colour.Gray;
                    }

                }
            }


            return colours;
        }

