        public static int getAmountOfInList(char chare, List<char> list)
        {
            int toReturn = 0;
            foreach (char element in list)
            {
                if (element == chare)
                {
                    toReturn++;
                }
            }
            return toReturn;
        }
        public static int getAmountOfInListThatAreNotGray(char charToCheck, List<char> list, List<Colour> colours)
        {
            int toReturn = 0;
            for (int i = 0; i < list.Count; i++)
            {
                if (list[i] == charToCheck)
                {
                    if (colours[i] != Colour.Gray)
                    {
                        toReturn++;
                    }
                }
            }
            return toReturn;
        }

        //************************ COMBINE ************************\\
        public CharKnowledge Combine(CharKnowledge that)
        {
            CharKnowledge result = new CharKnowledge();
            result.definitePositions = new HashSet<int>();
            result.unavailablePositions = new HashSet<int>();

            result.definitePositions.UnionWith(this.definitePositions);
            result.definitePositions.UnionWith(that.definitePositions);
            result.unavailablePositions.UnionWith(this.unavailablePositions);
            result.unavailablePositions.UnionWith(that.unavailablePositions);

            result.grayBeyond = this.grayBeyond ?? that.grayBeyond;
            if (this.grayBeyond != that.grayBeyond && this.grayBeyond != null && that.grayBeyond != null)
                throw new Exception("kaboom");

            int thisHasAtLeastThisManyInTotal = this.atLeastThisManyMore + this.definitePositions.Count;
            int thatHasAtLeastThisManyInTotal = that.atLeastThisManyMore + that.definitePositions.Count;
            int resultHasAtLeastThisManyInTotal = Math.Max(thisHasAtLeastThisManyInTotal, thatHasAtLeastThisManyInTotal);
            result.atLeastThisManyMore = Math.Max(resultHasAtLeastThisManyInTotal - result.definitePositions.Count, 0);

            return result;
        }

        //************************ COMBINEKNOWLEDGE ************************\\
        public static IDictionary<char, CharKnowledge> combineKnowledge(IDictionary<char, CharKnowledge> these, IDictionary<char, CharKnowledge> those)
        {
            if (these == null || those == null)
                return these ?? those;

            ISet<char> unionKeys = new HashSet<char>();
            unionKeys.UnionWith(these.Keys);
            unionKeys.UnionWith(those.Keys);

            var result = new Dictionary<char, CharKnowledge>();

            foreach (char key in unionKeys)
            {
                bool thisHasKey = these.ContainsKey(key);
                bool thatHasKey = those.ContainsKey(key);
                result.Add(key, thisHasKey && thatHasKey
                                    ? these[key].Combine(those[key])
                                    : new CharKnowledge(thisHasKey ? these[key] : those[key]));
            }
            return result;
        }
        public ISet<int> definitePositions;
        public int atLeastThisManyMore;
        public ISet<int> unavailablePositions;
        public int? grayBeyond;

        public static ISet<int> calcUnsolvedPositions(int wordLength, ICollection<CharKnowledge> values)
        {
            var result = new HashSet<int>();
            for (int i = 0; i < wordLength; i++)
                result.Add(i);
            foreach (var value in values)
                foreach (var position in value.definitePositions)
                    result.Remove(position);
            return result;
        }

        //************************ INFER ************************\\
        public static IDictionary<char, CharKnowledge> infer(int wordLength, IDictionary<char, CharKnowledge> input)
        {
            //? Input = whole table
            int atLeastThisAmountOfLettersMore = 0;

            var unsolvedPositions = calcUnsolvedPositions(wordLength, input.Values);

            foreach (var value in input.Values)
                atLeastThisAmountOfLettersMore += value.atLeastThisManyMore;

            //! RULE 1:
            /* if any character has unavaliable unsolved positions + atLeastThisManyMore adding up to all unsolvedPositions,
               infer available positions as definite, and return */
            foreach (KeyValuePair<char, CharKnowledge> kv in input)
            {
                var key = kv.Key;
                var val = kv.Value;
                var availableUnsolvedPositions = new HashSet<int>(unsolvedPositions);
                availableUnsolvedPositions.ExceptWith(val.unavailablePositions);

                if (availableUnsolvedPositions.Count == val.atLeastThisManyMore && availableUnsolvedPositions.Count != 0)
                {
                    var result = new Dictionary<char, CharKnowledge>(input);
                    var charKnowledge = new CharKnowledge(val);
                    result[key] = charKnowledge;
                    charKnowledge.definitePositions.UnionWith(availableUnsolvedPositions);
                    charKnowledge.atLeastThisManyMore = 0;

                    //? maybe we will set the unavailable positions but we think that it is unnecessary at the moment.
                    //charKnowledge.unavailablePositions = val.;

                    charKnowledge.grayBeyond = charKnowledge.definitePositions.Count;
                    return result;
                }
            }

            //! RULE 2
            /* If we know what all the letters are and how many of each letter there are, we know grayBeyond for any letter */
            int slack = unsolvedPositions.Count - atLeastThisAmountOfLettersMore;
            if (slack == 0)
            {
                bool modified = false;
                var absentCharKnowledge = new CharKnowledge();
                absentCharKnowledge.atLeastThisManyMore = 0;
                absentCharKnowledge.definitePositions = new HashSet<int>();
                absentCharKnowledge.grayBeyond = 0;
                absentCharKnowledge.unavailablePositions = new HashSet<int>();

                var result = new Dictionary<char, CharKnowledge>(input);

                for (char c = 'a'; c <= 'z'; c++)
                {
                    if (input.ContainsKey(c))
                    {
                        if (input[c].grayBeyond == null)
                        {
                            modified = true;
                            result[c].grayBeyond = result[c].definitePositions.Count + result[c].atLeastThisManyMore;
                        }
                    }
                    else
                    {
                        result.Add(c, absentCharKnowledge);
                        modified = true;
                    }
                }
                if (modified) return result;
            }
            return input;

        }

        public static T fixpoint<T>(Func<T, T> f, T input) where T : class
        {
            T old;
            do
            {
                old = input;
                input = f(input);

            } while (old != input);
            return old;
        }

        public static IDictionary<char, CharKnowledge> inferFully(int wordLength, IDictionary<char, CharKnowledge> input)
        {
            Func<IDictionary<char, CharKnowledge>, IDictionary<char, CharKnowledge>> infer = (x) => { return CharKnowledge.infer(wordLength, x); };
            return fixpoint<IDictionary<char, CharKnowledge>>(infer, input);
        }

