        private static IDictionary<char, CharKnowledge> copyDictionary(IDictionary<char, CharKnowledge> source)
        {
            var result = new Dictionary<char, CharKnowledge>();
            foreach (var kv in source)
                result.Add(kv.Key, new CharKnowledge(kv.Value));
            return result;
        }
        public static ISet<ISet<T>> ItemCombinations<T>(int k, ISet<T> set)
        {
            var order = new Dictionary<int, T>();
            int i = 0;
            foreach (var item in set)
                order.Add(i++, item);

            ISet<ISet<T>> result = new HashSet<ISet<T>>();

            foreach (var indexComb in Combinations(k, set.Count))
            {
                var s = new HashSet<T>();
                foreach (int index in indexComb)
                    s.Add(order[index]);
                result.Add(s);
            }
            return result;
        }

        //? k is how many youre choosing and n is the total things to choose from
        public static ISet<ISet<int>> Combinations(int k, int n)
        {
            assert(0 <= k && k <= n, "invalid binomial: " + n + " choose " + k);

            ISet<ISet<int>> result = new HashSet<ISet<int>>();
            if (k == 0)
            {
                result.Add(new HashSet<int>());
            }
            else if (k == n)
            {
                var s = new HashSet<int>();
                for (int i = 0; i < n; i++)
                {
                    s.Add(i);
                }
                result.Add(s);
            }
            else
            {
                // add all the results including 0
                foreach (var comb in Combinations(k - 1, n - 1))
                {
                    var s = new HashSet<int>();
                    s.Add(0);
                    foreach (int i in comb)
                        s.Add(i + 1);
                    result.Add(s);
                }

                // add all the results excluding 0
                foreach (var comb in Combinations(k, n - 1))
                {
                    var s = new HashSet<int>();
                    foreach (int i in comb)
                        s.Add(i + 1);
                    result.Add(s);
                }
            }
            return result;
        }


        //***********************! FROMGUESS !***********************\\
        public static IDictionary<char, CharKnowledge> fromGuess(string guess, List<Colour> guessResult)
        {
            //* Hashtable (map) keys are letters, value is set of pair of(position, color) which means each value is a set
            var charInfo = new Dictionary<char, ISet<KeyValuePair<int, Colour>>>();
            for (int i = 0; i < guess.Length; i++)
            {
                var letter = guess[i];
                var colour = guessResult[i];
                var pair = new KeyValuePair<int, Colour>(i, colour);
                if (!charInfo.ContainsKey(letter))
                    charInfo.Add(letter, new HashSet<KeyValuePair<int, Colour>>());
                ISet<KeyValuePair<int, Colour>> set = charInfo[letter];
                set.Add(pair);
            }

            var result = new Dictionary<char, CharKnowledge>();
            foreach (KeyValuePair<char, ISet<KeyValuePair<int, Colour>>> kv in charInfo)
            {
                CharKnowledge charKnowledge = new CharKnowledge();
                charKnowledge.definitePositions = new HashSet<int>();
                charKnowledge.unavailablePositions = new HashSet<int>();
                foreach (var pair in kv.Value)
                {
                    if (pair.Value == Colour.Green)
                    {
                        charKnowledge.definitePositions.Add(pair.Key);
                    }
                    if (pair.Value == Colour.Yellow)
                    {
                        charKnowledge.unavailablePositions.Add(pair.Key);
                    }
                }

                charKnowledge.atLeastThisManyMore = charKnowledge.unavailablePositions.Count;

                foreach (var pair in kv.Value)
                {
                    if (pair.Value == Colour.Gray)
                    {
                        charKnowledge.unavailablePositions.Add(pair.Key);
                        charKnowledge.grayBeyond = charKnowledge.atLeastThisManyMore + charKnowledge.definitePositions.Count;
                    }
                }

                result.Add(kv.Key, charKnowledge);


            }
            return result;
        }
